import React from 'react';
import './App.css';
import Nav from "./components/Nav"
import Card from './components/card';
import {Routes,Route} from "react-router-dom"
import Blog from './pages/Blog';
function App() { 

  return (
    <div className="App">
      <Nav/>
       <Routes>
        <Route path='/' element={<Blog/>}/>
       </Routes>
    </div>
  );
}

export default App;
